'use strict';
//@@DocInclude
//@@DocBrief("The class provides data for sending mail")
class SendClientMessageRequest {
    text;
    to;
    messageType;
    feature;
    subject;
    constructor() {
        this.text = "";
        this.to = "";
        this.messageType = "";
        this.feature = "";
        this.subject = "";
    }
    getText() {
        return this.text;
    }
    getTo() {
        return this.to;
    }
    getMessageType() {
        return this.messageType;
    }
    getFeature() {
        return this.feature;
    }
    getSubject() {
        return this.subject;
    }
}
module.exports = SendClientMessageRequest
